body:
Eximining other uses of `DataDir` it can be observed, that some cases need to use `ConfigDir` and some  the state dir (which is not introduced). For example, I feel that `ffmpeg_presets.xml` is a config file, not data file. This is not critical, however.

What is more important, it seems that `ConfigDir` and `DataDir` are sharing large amount of code.  

I think we should have some internal function like this

```
enum class DirTarget
{
  Config,
  Data,
  State
};

wxString GetUserDir(DirTarget target);
```

One suggestion. I looked into `EffectsManager` implemenation and to me it seem that actually there are two interfaces combined: one for effects and the second one for commands. Attempt to extract `IAudacityCommand` results in massive changes that are unlikely useful for Audacity 4 progress (but if so, what I suggest does not prevent us from future refactroing).
Alternative solution is to define abstract command interface inside EffectManager:
```
class EffectsManager {
public:

class BasicCommandsInterface
{
public:

   virtual bool HasCommand(const PluginID& id) = 0;
   virtual bool Do(const PluginID& id) = 0;
   virtual wxString GetURL(const PluginID& id) = 0;
   virtual wxString GetDescription(const PluginID& id) = 0;
   ...
};

struct PREFERENCES_API CommandsInterface final : GlobalHook<CommandsInterface, BasicCommandsInterface&()> { };

...
};

...
//Inject commands interface
static EffectsManager::CommandsInterface::Scope audacityCommandsInterfaceScope {
   []{ 
       static AudacityWxCommandsInterface commandsInterface;
       return commandsInterface;
      }
};

```

I expect that that would require very few trivial changes in `EffectsManager`

After spending quite a lot of time going multiple times through this PR I am still very confused with naming used and with semantics behind those names. I think this is something that should be improved.

In the commit that introduces Handle it feels like some work is missing. `wxMenu` is used directly instead of Handle methods.

In general, I think that this is the case where we should separate the **definition** of menu and the toolkit specific code in two different layers instead of proposed `Handle` approach.

Consider pseudocode like

```
BasicMenu::Menu menu;

menu.Append(XO("No Effect"). []{})'
menu.AppendSeparator();
...

// wxMenu is only created here...
BasicMenu::Popup(menu);
```

I think it will simplify the lifetime management quite a bit.
